INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<p class="address">C-244, 2nd Floor, Sector-63, Noida, India.</p>\r\n<p class="phone">Telephone: 0120-42-81666</p>\r\n<p class="e-mail">E-mail: <a href="mailto:info@drupalchamp.com">info@drupalchamp.com</a></p>', 'Find Us', 'full_html'),
(2, '<h2>Copiosae iracundia splendide ex nam erroribus proident occaecat culpa qui</h2>\r\n<p>Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui. Impetus vivendo accusam vim ex, illum animal tractatos te sit. Ei vix causae officiis reprehendunt, vel eros  id.</p>', 'Tagline box', 'full_html'),
(3, '<p>Copyright 2014 <span>vrinda</span> | All Rights Reserved | Powered by <a href="http://drupal.org/">Drupal</a> | <a href="http://drupalchamp.com">Drupalchamp</a></p>', 'Copyrights', 'full_html'),
(4, '<div class="columns">\r\n<div class="col-one-half">\r\n<h3>Mobile Ready</h3>\r\n<p>Responsive web design is a web design approach aimed at crafting sites to provide an optimal viewing experience—easy reading and navigation with a minimum of resizing, panning, and scrolling—across a wide range of devices (from desktop computer monitors to mobile phones)</p>\r\n<div class="read-more"><a href="#">Read More</a></div>\r\n</div>\r\n<div class="col-one-half">\r\n<img class="aligncenter" alt="" src="sites/default/files/images/responsive-design.png">\r\n</div>\r\n</div>', 'Responsive Design', 'full_html'),
(5, '<div class="columns">\r\n<div class="col-one-third">\r\n<div class="content-boxes icon-boxed">\r\n<div class="icon-and-header">\r\n<i class="fa fa-file-text fa-2x circle filled"></i>\r\n<h2><a href="#">Knowledge Base</a></h2>\r\n</div>\r\n<div class="content-boxes-content">\r\n<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore.</p>\r\n<div class="read-more"><a href="http://drupalchamp.come">Learn More</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-one-third">\r\n<div class="content-boxes icon-boxed">\r\n<div class="icon-and-header">\r\n<i class="fa fa-share-square-o fa-2x circle filled"></i>\r\n<h2><a href="#">Support Forum</a></h2>\r\n</div>\r\n<div class="content-boxes-content">\r\n<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore.</p>\r\n<div class="read-more"><a href="http://drupalchamp.come">Learn More</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-one-third">\r\n<div class="content-boxes icon-boxed">\r\n<div class="icon-and-header">\r\n<i class="fa fa-coffee fa-2x circle filled"></i>\r\n<h2><a href="#">Contact</a></h2>\r\n</div>\r\n<div class="content-boxes-content">\r\n<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore.</p>\r\n<div class="read-more"><a href="http://drupalchamp.come">Learn More</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Faq block', 'full_html'),
(6, '<p class="text-center">Vrinda is created with modern browsers and devices in mind and employ the cutting edge <br />\r\nhtml, css and javascript technologies and ready to operate fully out of the box</p>', 'Core Features of Vrinda', 'full_html');
